import React, { useEffect, useState } from "react";
import axios from "axios";
import "../styles/MainLayout.css";

function Home() {
  const [accounts, setAccounts] = useState([]);
  const [formData, setFormData] = useState({ title: "", username: "", password: "", note: "" });
  const [editingAccount, setEditingAccount] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchAccounts();
  }, []);

  const fetchAccounts = async () => {
    try {
      const response = await axios.get("http://localhost:5059/api/Accounts");
      setAccounts(response.data);
      setLoading(false);
    } catch (error) {
      console.error("Veriler alınamadı:", error);
    }
  };

  const handleChange = (e) => {
    setFormData(prev => ({ ...prev, [e.target.name]: e.target.value }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      if (editingAccount) {
        await axios.put(`http://localhost:5059/api/Accounts/${editingAccount.id}`, {
          ...editingAccount,
          ...formData,
        });
        setEditingAccount(null);
      } else {
        await axios.post("http://localhost:5059/api/Accounts", formData);
      }

      setFormData({ title: "", username: "", password: "", note: "" });
      fetchAccounts();
    } catch (error) {
      console.error("İşlem hatası:", error);
    }
  };

  const handleEdit = (account) => {
    setEditingAccount(account);
    setFormData({
      title: account.title,
      username: account.username,
      password: account.password,
      note: account.note || "",
    });
  };

  const handleDelete = async (id) => {
    if (window.confirm("Bu kaydı silmek istediğinize emin misiniz?")) {
      try {
        await axios.delete(`http://localhost:5059/api/Accounts/${id}`);
        fetchAccounts();
      } catch (error) {
        console.error("Silme hatası:", error);
      }
    }
  };

  return (
    <div className="home-container">
      <h2>ND Account Manager</h2>

      <form onSubmit={handleSubmit} className="account-form">
        <input type="text" name="title" placeholder="Başlık" value={formData.title} onChange={handleChange} required />
        <input type="text" name="username" placeholder="Kullanıcı Adı" value={formData.username} onChange={handleChange} required />
        <input type="text" name="password" placeholder="Şifre" value={formData.password} onChange={handleChange} required />
        <textarea name="note" placeholder="Not" value={formData.note} onChange={handleChange} />
        <button type="submit">{editingAccount ? "Güncelle" : "Ekle"}</button>
        {editingAccount && (
          <button type="button" className="cancel-btn" onClick={() => { setEditingAccount(null); setFormData({ title: "", username: "", password: "", note: "" }); }}>
            İptal
          </button>
        )}
      </form>

      <hr />

      {loading ? (
        <p>Yükleniyor...</p>
      ) : (
        <div className="account-list">
          {accounts.length === 0 ? (
            <p>Henüz kayıtlı hesap yok.</p>
          ) : (
            accounts.map((acc) => (
              <div key={acc.id} className="account-card">
                <h4>{acc.title}</h4>
                <p><strong>Kullanıcı Adı:</strong> {acc.username}</p>
                <p><strong>Şifre:</strong> {acc.password}</p>
                <p><strong>Not:</strong> {acc.note}</p>
                <div className="card-buttons">
                  <button onClick={() => handleEdit(acc)}>Düzenle</button>
                  <button onClick={() => handleDelete(acc.id)} className="delete-btn">Sil</button>
                </div>
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
}

export default Home;
